    const onFetchOrders = (FID) => {
        if(FID){
        console.log(FID)

            getMyOrders(FID).then(res => {
                console.log(res)
            })
            .catch(err => {
    
            })
        }
        
    }
    const redirectToSign = () => {
        console.log("<<",Fid)

        if(!Fid){
            console.log(">>",Fid)
            return <Redirect to="/fleets"/>
        }
    }
    useEffect(() => {
        setFid(getFleetsId())

        onFetchOrders(Fid)
    }, [])
